    public void alertNotFNode(String title, String alarm){
        Alert alert = new Alert(Alert.AlertType.WARNING);
        alert.initOwner(this.getPrimaryStage());
        alert.setTitle(title);
        alert.setHeaderText(alarm);
        alert.showAndWait();
    }

    @Override
    public void start(Stage primaryStage) throws Exception{

        this.primaryStage = primaryStage;
        this.primaryStage.setTitle("Keter");
        //this.primaryStage.setScene(new Scene(root, 1200, 600));
        this.primaryStage.setResizable(false);

        if(authorization()) {
            initRootLayout();
            showNodeData();
        }
        //this.primaryStage.show();
    }

    public void initRootLayout() {
        try {

            FXMLLoader loader = new FXMLLoader();
            loader.setLocation(Main.class.getResource("/rootLayout.fxml"));
            root = loader.load();

            Scene scene = new Scene(root);
            primaryStage.setScene(scene);
            primaryStage.show();
        } catch (IOException e) {
            e.printStackTrace();
        }
    }

    public ObservableList<MainNode> getNodeData() {
        return nodeData;
    }

    public Stage getPrimaryStage() {
        return primaryStage;
    }

    public void showNodeData() {
        try {
            FXMLLoader loader = new FXMLLoader();
            loader.setLocation(Main.class.getResource("/sample.fxml"));
            AnchorPane nodeOverview = (AnchorPane) loader.load();

            root.setCenter(nodeOverview);

            NodeListController controller = loader.getController();
            //controller.setMainApp(this);
            controller.setMainApp(this);
        } catch (IOException e) {
            e.printStackTrace();
        }
    }

    public boolean authorization() {
        try {

            FXMLLoader loader = new FXMLLoader();
            loader.setLocation(Main.class.getResource("/authorization.fxml"));
            AnchorPane page = (AnchorPane) loader.load();

            Stage dialogStage = new Stage();
            dialogStage.setResizable(false);
            dialogStage.initModality(Modality.WINDOW_MODAL);
            dialogStage.initOwner(primaryStage);
            dialogStage.setTitle("Авторизация");
            Scene scene = new Scene(page);
            dialogStage.setScene(scene);

            AuthorizationController controller = loader.getController();
            controller.setDialogStage(dialogStage);
            ///controller.setPerson(person);

            // Отображаем диалоговое окно и ждём, пока пользователь его не закроет
            controller.setMainApp(this);
            dialogStage.showAndWait();

            return controller.isOkClicked();
        } catch (IOException e) {
            e.printStackTrace();
            return false;
        }
    }

    public boolean createGraph() {
        try {
            // Загружаем fxml-файл и создаём новую сцену
            // для всплывающего диалогового окна.
            FXMLLoader loader = new FXMLLoader();
            loader.setLocation(Main.class.getResource("/createGraph.fxml"));
            AnchorPane page = (AnchorPane) loader.load();

            // Создаём диалоговое окно Stage.
            Stage dialogStage = new Stage();
            dialogStage.setResizable(false);
            dialogStage.initModality(Modality.WINDOW_MODAL);
            dialogStage.initOwner(primaryStage);
            dialogStage.setTitle("Создание графа");
            Scene scene = new Scene(page);
            dialogStage.setScene(scene);

            GraphCreateController controller = loader.getController();
            controller.setDialogStage(dialogStage);
            ///controller.setPerson(person);

            // Отображаем диалоговое окно и ждём, пока пользователь его не закроет
            controller.setMainApp(this);
            dialogStage.showAndWait();

            return controller.isOkClicked();
        } catch (IOException e) {
            e.printStackTrace();
            return false;
        }
    }

    public boolean runNode() {
        try {
            FXMLLoader loader = new FXMLLoader();
            loader.setLocation(Main.class.getResource("/runNode.fxml"));
            AnchorPane page = (AnchorPane) loader.load();

            Stage dialogStage = new Stage();
            dialogStage.setResizable(false);
            dialogStage.initModality(Modality.WINDOW_MODAL);
            dialogStage.initOwner(primaryStage);
            dialogStage.setTitle("Запуск узлов");
            Scene scene = new Scene(page);
            dialogStage.setScene(scene);

            NodeRunController controller = loader.getController();
            controller.setDialogStage(dialogStage);

            controller.setMainApp(this);
            dialogStage.showAndWait();

            return controller.isOkClicked();
        } catch (IOException e) {
            e.printStackTrace();
            return false;
        }
    }

    public boolean runGraph() {
        try {
            FXMLLoader loader = new FXMLLoader();
            loader.setLocation(Main.class.getResource("/runGraph.fxml"));
            AnchorPane page = (AnchorPane) loader.load();

            Stage dialogStage = new Stage();
            dialogStage.setResizable(false);
            dialogStage.initModality(Modality.WINDOW_MODAL);
            dialogStage.initOwner(primaryStage);
            dialogStage.setTitle("Запуск графов");
            Scene scene = new Scene(page);
            dialogStage.setScene(scene);

            GraphRunController controller = loader.getController();
            controller.setDialogStage(dialogStage);

            controller.setMainApp(this);
            dialogStage.showAndWait();

            return controller.isOkClicked();
        } catch (IOException e) {
            e.printStackTrace();
            return false;
        }
    }

